-- Disclaimer:
-- Data is artificially and randomly generated, partially from a set of existing lists, and in no way represents reality.
-- The database and its contents may also intentionally be poorly designed, incomplete and missing.
-- The contents of this database are only intended for educational purposes in the field of database retrieval.

-- Original source for plant lists: http://www.extrafloralnectaries.org/the-list.html

drop table if exists PlantedIn;
drop table if exists FlowerBeds;
drop table if exists Parks;
drop table if exists Plants;
drop table if exists Families;
drop table if exists Types;
drop table if exists People;

-- Tables

create table People (
	ID int primary key,
	name varchar not null,
	position varchar not null
);

create table Types (
	ID int primary key,
	name varchar not null
);

create table Families (
	ID int primary key,
	typeID int not null references Types(ID),
	name varchar not null
);

create table Plants (
	ID int primary key,
	familyID int references Families(ID),
	name varchar not null
);

create table Parks (
  ID int primary key,
  name varchar not null unique
);

create table FlowerBeds (
	ID int primary key,
  parkID int not null references Parks(ID),
	size float not null,
	description varchar not null
);

create table PlantedIn (
	flowerbedID int not null references FlowerBeds(ID),
	plantID int not null references Plants(ID),
	percentage int not null,
	planterID int not null references People(ID),
	primary key (flowerbedID, plantID)
);

\set CLIENT_ENCODING 'UTF8'
\set ON_ERROR_STOP on
\set AUTOCOMMIT off

-- Data

COMMIT;
